function App() {
  return (
    <Router>   {/* //we will use react router dom so that on clicking home button we can go to home page */}
      <div>
        <Routes>
          <Route exact path='/' element={<Home></Home>}></Route>

        </Routes>
      </div>

    </Router>
  );
}

export default App;
